import React from 'react'

const Home = () => {
    const posts = [
        {
            id: 1,
            title: "Armbars and Headlocks",
            desc: "lorem",
            img: "https://www.pexels.com/photo/two-martial-artists-fighting-each-other-8612476/"
        }
    ]
    return (
        <div className="home">
            <div className="posts">
                {posts.map}

            </div>

        </div>
    )
}

export default Home
